    false,nt"url": null,nt"notes": "The Lower Souris Migratory Waterfowl Refuge
    (now known as the J. Clark Salyer National Wildlife Refuge) is located just south
    of the Canadian border in North Dakota. The refuge was established and constructed
    by the CCC in 1935 to restore waterfowl habitat. This report gives an overview of
    events taking place on the refuge for February, March and April of 1940. The table
    of contents includes sections on personnel, general conditions, wildlife, plantings,
    refuge development and maintenance, predator control, refuge improvements, scientific
    progress, law enforcement, water conditions and photographs.",nt"license_title":
